```javascript
function isPalindrome(str) {
    // Remove non-alphanumeric characters and convert to lowercase
    const cleanedStr = str.replace(/[^a-zA-Z0-9]/g, '').toLowerCase();

    // Compare the string with its reverse
    return cleanedStr === cleanedStr.split('').reverse().join('');
}

// Example usage:
console.log(isPalindrome("A man, a plan, a canal: Panama")); // true
console.log(isPalindrome("racecar")); // true
console.log(isPalindrome("hello")); // false
```

### Explanation:
1. **Cleaning the String**: The function first removes any non-alphanumeric characters from the string using a regular expression (`/[^a-zA-Z0-9]/g`). This includes spaces, punctuation, and symbols. It then converts the string to lowercase to ensure the comparison is case-insensitive.
2. **Checking for Palindrome**: The cleaned string is then compared to its reverse. The reverse is obtained by splitting the string into an array of characters, reversing the array, and then joining it back into a string.
3. **Return Value**: The function returns `true` if the cleaned string is equal to its reverse, indicating that it is a palindrome. Otherwise, it returns `false`.

### Example Usage:
- The function is tested with three examples:
  - `"A man, a plan, a canal: Panama"` is a palindrome when ignoring punctuation and case.
  - `"racecar"` is a straightforward palindrome.
  - `"hello"` is not a palindrome.

