public class PalindromeChecker {

    public static boolean isPalindrome(String str) {
        // Remove non-alphanumeric characters and convert to lowercase
        String cleanedStr = str.replaceAll("[^a-zA-Z0-9]", "").toLowerCase();

        // Compare the string with its reverse
        int left = 0;
        int right = cleanedStr.length() - 1;

        while (left < right) {
            if (cleanedStr.charAt(left) != cleanedStr.charAt(right)) {
                return false;
            }
            left++;
            right--;
        }

        return true;
    }

    public static void main(String[] args) {
        // Example usage
        System.out.println(isPalindrome("A man, a plan, a canal: Panama")); // true
        System.out.println(isPalindrome("racecar")); // true
        System.out.println(isPalindrome("hello")); // false
    }
}
```

### Explanation:
1. **Cleaning the String**: 
   - The `replaceAll("[^a-zA-Z0-9]", "")` method removes any non-alphanumeric characters from the string.
   - The `toLowerCase()` method converts the string to lowercase to ensure the comparison is case-insensitive.

2. **Checking for Palindrome**:
   - Two pointers, `left` and `right`, are used to compare characters from the beginning and the end of the cleaned string.
   - If any characters at these pointers do not match, the function returns `false`.
   - The pointers move towards each other until they meet or cross.

3. **Return Value**:
   - The function returns `true` if all characters match, indicating that the string is a palindrome.
   - Otherwise, it returns `false`.

